import React, {Component} from 'react'

const TableHeader = () => {
  return (
    <thread>
      <tr>
        <th>musician</th>
      </tr>
    </thread>
  )
}

const TableBody = (props) => {
    const columns = props.nameData.map((column, index) => {
      return (
        <tc key={index}>
          <td>{column.artistName}</td>
          <td>
            <button onClick={() => props.removeName(index)}>Delete</button>
          </td>
        </tc>
      )
    }
  )

  return (
    <tbody>{columns}</tbody>
  )
}

const ResponseBody = (props) => {
  const columnsResponses = props.responsesData.map((column, index) => {
    return (
      <tc key={index}>
        <td>{column}</td>
      </tc>
    )
  }
)

  return (
    <tbody>{columnsResponses}</tbody>
  )
}


const Table = (props) => {
  const {nameData, removeName, responsesData} = props

  return (
    <table>
      <TableHeader />
      <TableBody nameData={nameData} removeName={removeName} />
      <ResponseBody responsesData={responsesData} />
    </table>
  )
}

export default Table
